    function getStorageKey() {
        var key = '';
        if (options && options.key) {
            key = options.key;
        }
        return 'alan-btn-options-' + key;
    }

    function isMobile() {
        if (/Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent)) {
            return true;
        }
        return false;
    }

    function isIpadOS() {
        return navigator.maxTouchPoints &&
            navigator.maxTouchPoints > 2 &&
            /MacIntel/.test(navigator.platform);
    }

    function isOriginSecure() {
        var isSecure = false;
        var protocol = window.location.protocol;
        var hostname = window.location.hostname;

        if (protocol === 'https:') {
            isSecure = true;
        }

        if (protocol === 'file:') {
            isSecure = true;
        }

        if (protocol === 'http:' && (hostname.indexOf('localhost') > -1 || hostname.indexOf('127.0.0.1') > -1)) {
            isSecure = true;
        }

        return isSecure;
    }

    function isAudioSupported() {
        var available = false,
            fakeGetUserMedia,
            fakeContext;

        fakeGetUserMedia = (navigator.getUserMedia ||
            navigator.webkitGetUserMedia ||
            navigator.mozGetUserMedia ||
            navigator.msGetUserMedia ||
            (navigator.mediaDevices && navigator.mediaDevices.getUserMedia));

        fakeContext = window.AudioContext ||
            window.webkitAudioContext ||
            window.mozAudioContext;

        if (fakeGetUserMedia && fakeContext) {
            available = true;
        }

        return available;
    }

